import { useState } from "react";
import loginImg from "./loginImg.jpg";

const peopleData = [
  { id: 1, name: "Alice Johnson" },
  { id: 2, name: "Bob Smith" },
  { id: 3, name: "Charlie Davis" },
  { id: 4, name: "Diana Prince" },
  { id: 5, name: "Edward Snowden" }
];

function App() {
  const [loggedIn, setLoggedIn] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [search, setSearch] = useState("");

  const handleLogin = (e) => {
    e.preventDefault();
    if (username === "admin" && password === "password") {
      setLoggedIn(true);
    } else {
      alert("Invalid credentials");
    }
  };

  const filteredPeople = peopleData.filter(person =>
    person.name.toLowerCase().includes(search.toLowerCase())
  );

  if (!loggedIn) {
    return (
      <div className="min-h-screen flex justify-center items-center bg-white">
        {/* Left: Login Form */}
        <div className="w-1/2 flex-col items-center items-center justify-center space-between">
          <form
            onSubmit={handleLogin}
            className=" p-8 w-full max-w-sm mx-auto"
          > 

            <h2 className="text-2xl mb-2 text-left">Welcome üëã</h2>
            <h2 className="text-sm text-gray-400 mb-6 text-left font-extralight">Please login with your health username and password, to continue.</h2>
            <h2 className="text-sm text-black text-left mb-1">Username</h2>
            <input
              type="text"
              placeholder="Username"
              className="w-full mb-4 px-4 py-2 border rounded focus:outline-none focus:ring  bg-blue-50"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
            <h2 className="text-sm text-black text-left mb-1">Password</h2>
            <input
              type="password"
              placeholder="Password"
              className="w-full mb-2 px-4 py-2 border rounded focus:outline-none focus:ring bg-blue-50"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <a href="#" className="text-sm mb-4 text-blue-500 hover:underline text-right flex flex-row-reverse">Forgot password?</a>
            <button
              type="submit"
              className="w-full bg-slate-900 hover:bg-slate-600 text-white py-2 rounded-xl"
            >
              Sign In
            </button>
            <p className="text-sm text-black font-light text-center mt-8 mx-4">Don't you have an account? Please contact a system administrator</p>

          </form>
          <p className="text-sm text-gray-400 text-center mt-8 mx-4">¬© 2025 ALL RIGHTS RESERVED - McSmart Meal</p>
        </div>

        {/* Right: Image */}
        <div className="w-1/2 flex items-center justify-center p-6 bg-white">
          <img
            src={loginImg}
            alt="Login Illustration"
            className="w-[90%] h-[90vh] shadow-lg rounded-2xl"
          />
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-blue-50 p-8">
      <div className="flex items-center justify-between mb-6 w-full">
      {/* Left: Greeting */}
      <h1 className="text-3xl text-left">Hello Admin User üëãüèº,</h1>

      {/* Right: Search Bar */}
      <div className="relative w-64">
        <input
          type="text"
          placeholder="Search people..."
          className="w-full pl-10 pr-4 py-2 rounded-xl bg-white text-black placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-400 shadow-md"
          value={search}
          onChange={e => setSearch(e.target.value)}
        />
        <svg
          className="absolute left-3 top-1/2 transform -translate-y-1/2 w-5 h-5 text-black"
          xmlns="http://www.w3.org/2000/svg"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
        >
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-4.35-4.35m0 0A7.5 7.5 0 104.5 4.5a7.5 7.5 0 0012.15 12.15z" />
        </svg>
      </div>
    </div>

      <div className="mx-auto bg-white p-6 rounded-2xl shadow">
        <h1 className="text-xl font-bold mb-1 text-left">All Detected Scans</h1>
        <h2 className="text-xs mb-2 text-left text-red-900">Immediate Action Required</h2>
        <ul>
          {filteredPeople.length > 0 ? (
            filteredPeople.map(person => (
              <li
                key={person.id}
                className="p-2 border-b border-gray-200 text-gray-800 hover:bg-blue-50 cursor-pointer transition-colors flex-row"
              >
                {person.name}
              </li>
            ))
          ) : (
            <li className="text-gray-500">No matches found.</li>
          )}
        </ul>
      </div>
    </div>
  );
}

export default App;
